import React from 'react';
import classes from './Nav.module.css';
co


const Nav = () => {
    return (
        <nav className={classes.nav}>
            <ul>
                <li className={`${classes.item} ${classes.active}`}><a>Profile</a></li>
                <li className={`${classes.item} ${classes.active}`}><a>Messages</a></li>
                <li className={`${classes.item} ${classes.active}`}><a>News</a></li>
                <li className={`${classes.item} ${classes.active}`}><a>Music</a></li>
                <li className={`${classes.item} ${classes.active}`}><a>Settings</a></li>
            </ul>
        </nav>
    )
}


export default Nav;
